inline int read(){
	int x=0,f=1;char ch=getchar();
	while(ch<'0'||ch>'9'){if(ch=='-')f=-1;ch=getchar();}
	while(ch>='0'&&ch<='9'){x=x*10+ch-'0';ch=getchar();}
	return x*f;
}
inline void wri(ll x){
	if(x>=10) wri(x/10);
	putchar(x%10+'0');
}
void write(ll x){
	if(x<0){putchar('-'); x=-x;}
	wri(x);
}
void writeln(ll x){
	write(x);
	puts("");
}

